// SPDX-License-Identifier: MIT
pragma solidity >=0.8.14 <0.9.0;

import {Ownable} from "../../abstract/Ownable.sol";
import {ListHarvesterCursor} from "../../cursor/farmer/ListHarvesterCursor.sol";
import {Harvester} from "../../struct/farmer/Harvester.sol";
import {DATABASE_KEY} from "../../constant/SecretKey.sol";

contract HarvesterController is Ownable, ListHarvesterCursor {
    constructor(address listHarvesterAddress)
        Ownable()
        ListHarvesterCursor(listHarvesterAddress)
    {}

    function addHarvester(uint256 category)
        public
        notExistHarvesterAccount
        returns (bool)
    {
        Harvester memory item = Harvester(0, msg.sender, category);
        return _getListHarvesterCursor().add(item, DATABASE_KEY);
    }

    function getAllHarvester() public view returns (Harvester[] memory) {
        Harvester[] memory list = new Harvester[](
            _getListHarvesterCursor().getLength(DATABASE_KEY)
        );
        for (
            uint256 i = 1;
            i <= _getListHarvesterCursor().getLength(DATABASE_KEY);
            i++
        ) {
            list[i] = _getListHarvesterCursor().at(i, DATABASE_KEY);
        }
        return list;
    }
}

