// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12 <0.9.0;

import {ListHarvester} from "../../database/farmer/ListHarvester.sol";
import {Harvester} from "../../struct/farmer/Harvester.sol";
import {DATABASE_KEY} from "../../constant/SecretKey.sol";

abstract contract ListHarvesterCursor {
    ListHarvester private listHarvesterCursor;
    address private listHarvesterAddress;

    constructor(address value) {
        listHarvesterAddress = value;
        listHarvesterCursor = ListHarvester(value);
    }

    modifier onlyHarvesterUser(address user, address value) {
        require(
            _checkHarvesterUser(user, value),
            "ListHarvesterCursor: caller is not the user"
        );
        _;
    }

    modifier onlyHarvesterIdBelongstoAddress(uint256 id) {
        require(
            _checkExistHarvesterAccount(),
            "ListHarvesterCursor: Address not belongs to the account"
        );
        require(
            _checkHarvesterIdBelongstoAddress(id),
            "ListHarvesterCursor: id is not belong to address"
        );
        _;
    }
    modifier existHarvesterAccount() {
        require(
            _checkExistHarvesterAccount(),
            "ListHarvesterCursor: Not has account"
        );
        _;
    }
    modifier notExistHarvesterAccount() {
        require(
            !_checkExistHarvesterAccount(),
            "ListHarvesterCursor: Already existed account"
        );
        _;
    }

    function _checkExistHarvesterAccount() public view returns (bool) {
        uint256 id = listHarvesterCursor.findHarvesterIdByAddress(
            msg.sender,
            DATABASE_KEY
        );
        if (id > 0) return true;
        return false;
    }

    function _checkHarvesterUser(address user, address value)
        internal
        pure
        returns (bool)
    {
        if (user == value) return true;
        return false;
    }

    function _checkHarvesterIdBelongstoAddress(uint256 id)
        internal
        view
        returns (bool)
    {
        Harvester memory item = listHarvesterCursor.at(id, DATABASE_KEY);
        return _checkHarvesterUser(item.harvesterAddress, msg.sender);
    }

    function _getListHarvesterCursor() internal view returns (ListHarvester) {
        return listHarvesterCursor;
    }
}

