// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12 <0.9.0;

import {Ownable} from "../../abstract/Ownable.sol";

import {DATABASE_KEY} from "../../constant/SecretKey.sol";

import {Harvester} from "../../struct/farmer/Harvester.sol";

contract ListHarvester is Ownable {
    mapping(uint256 => Harvester) private list;
    uint256 private autoIncrement = 0;

    constructor() Ownable() {}

    event Add(Harvester item);

    event Remove(Harvester item);

    modifier requestSecretkey(bytes32 value) {
        require(
            value == DATABASE_KEY,
            "Database ListHarvester: Secret key error"
        );
        _;
    }

    modifier validIndex(uint256 index) {
        require(
            (1 <= index) && (index <= autoIncrement),
            "Database ListHarvester: Invalid index"
        );
        _;
    }

    function getLength(bytes32 secret)
        public
        view
        requestSecretkey(secret)
        returns (uint256)
    {
        return autoIncrement;
    }

    function add(Harvester memory item, bytes32 secret)
        public
        requestSecretkey(secret)
        returns (bool)
    {
        autoIncrement++;
        item.harvesterId = autoIncrement;
        list[autoIncrement] = item;
        emit Add(item);
        return true;
    }

    function at(uint256 index, bytes32 secret)
        public
        view
        requestSecretkey(secret)
        validIndex(index)
        returns (Harvester memory)
    {
        // require(index < list.length, "index must be less than list length");
        return list[index];
    }

    function findHarvesterIdByAddress(address value, bytes32 secret)
        public
        view
        requestSecretkey(secret)
        returns (uint256)
    {
        for (uint256 i = 1; i <= autoIncrement; i++) {
            if (list[i].harvesterAddress == value) return list[i].harvesterId;
        }
        return 0;
    }

    function hide(uint256 index, bytes32 secret)
        public
        requestSecretkey(secret)
        validIndex(index)
        returns (bool)
    {
        Harvester memory gap = Harvester(0, address(0), 0);
        list[index] = gap;
        return true;
    }

    // setter //////////////////////////////////////////////////////////////////////////
    function setHarvester(
        uint256 index,
        bytes32 secret,
        uint256 category
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].category = category;
        return true;
    }
}

